  rc_dynamics_api: <?xml version="1.0" ?><package format="2"><name>rc_dynamics_api</name><version>0.10.3</version><description>The rc_dynamics_api provides an API for easy handling of the dynamic-state data streams provided by Roboception's stereo camera with self-localization. See http://rc-visard.com Dynamic-state estimates of the rc_visard relate to its self-localization and ego-motion estimation. These states refer to rc_visard's current pose, velocity, or acceleration and are published on demand via several data streams. For a complete list and descriptions of these dynamics states and the respective data streams please refer to rc_visard's user manual.</description><maintainer email="felix.ruess@roboception.de">Felix Ruess</maintainer><author email="heiko.hirschmueller@roboception.de">Heiko Hirschmueller</author><author email="christian.emmerich@roboception.de">Christian Emmerich</author><author email="felix.endres@roboception.de">Felix Endres</author><license>BSD</license><url type="website">http://rc-visard.com</url><url type="repository">https://github.com/roboception/rc_dynamics_api</url><url type="bugtracker">https://github.com/roboception/rc_dynamics_api/issues</url><buildtool_depend>cmake</buildtool_depend><build_depend>protobuf-dev</build_depend><exec_depend>protobuf</exec_depend><depend>curl</depend><doc_depend>doxygen</doc_depend><export><build_type>cmake</build_type></export></package>
  rc_genicam_api: <?xml version="1.0" ?><package format="2"><name>rc_genicam_api</name><version>2.8.1</version><description>GenICam/GigE Vision Convenience Layer. This package combines the Roboception convenience layer for images with the GenICam reference implementation and a GigE Vision transport layer. It is a self contained package that permits configuration and image streaming of GenICam / GigE Vision 2.0 compatible cameras like the Roboception rc_visard. This package also provides some tools that can be called from the command line for discovering cameras, changing their configuration and streaming images. Although the tools are meant to be useful when working in a shell or in a script, their main purpose is to serve as example on how to use the API for reading and setting parameters, streaming and synchronizing images. See LICENSE.md for licensing terms of the different parts.</description><maintainer email="felix.ruess@roboception.de">Felix Ruess</maintainer><maintainer email="heiko.hirschmueller@roboception.de">Heiko Hirschmueller</maintainer><author email="heiko.hirschmueller@roboception.de">Heiko Hirschmueller</author><license>BSD</license><url type="website">http://wiki.ros.org/rc_genicam_api</url><url type="repository">https://github.com/roboception/rc_genicam_api</url><url type="bugtracker">https://github.com/roboception/rc_genicam_api/issues</url><buildtool_depend>cmake</buildtool_depend><depend>libpng-dev</depend><depend>libusb-1.0</depend><depend>libncurses-dev</depend><doc_depend>doxygen</doc_depend><export><build_type>cmake</build_type></export></package>
